import React, { Component } from "react";
import { w3cwebsocket as W3CWebSocket } from "websocket";

const client = new W3CWebSocket(
  "ws://stream.tradingeconomics.com/?client=guest:guest"
);
const msg = { topic: "subscribe", "to": "EURUSD:CUR" }

class EURUSDrate extends Component {

  componentWillMount() {
    client.onopen = () => {
      console.log("WebSocket Client Connected");
    };

    client.onopen = function() {
        const result = client.send((JSON.stringify(msg)))
        console.log(result)   
    }

    client.onmessage = (result) => {
      console.log(result.data);
    };
  }

  render() {
    return <div>Hola.</div>;
  }
}

export default EURUSDrate;
